import React from 'react';
import karnataka3 from "../images/karnataka3.png";
function Home() {
  return (
    <div>
      <br/>
      <center>
      <img src={karnataka3} alt="Profile" style={{ maxWidth: "50%" }} />
      </ center>
    </div>
  );
}

export default Home;
